import React, {useCallback, useRef, useState} from "react";
import {
    LoadScript,
    GoogleMap,
    MarkerClusterer,
    Marker,
    OverlayView
} from "@react-google-maps/api";

export default function App() {
    let [map, setMap] = useState(null);
    let canvasRef = useRef(null);

    const [markers, setMarkers] = useState([]);

    const [imageBounds, setImageBounds] = useState(null);
    const [overlayPane, setOverlayPane] = useState(
        OverlayView.OVERLAY_MOUSE_TARGET
    );

    const onLoad = useCallback((map) => {
        setMap(map);

        const bounds = new window.google.maps.LatLngBounds();
        setImageBounds(bounds);

        map.setCenter({lat: 32.803356869891665, lng: -97.09699318526077});
    }, []);

    const onUnmount = useCallback((map) => {
        setMap(null);
    }, []);

    //Draw image
    const showImage = () => {
        // const canvas = canvasRef.current;
        // // canvas.width = 3313;
        // // canvas.height = 1082;
        // const ctx = canvas.getContext("2d");
        // let imageData = ctx.createImageData(3313, 1082);

        // let data = imageData.data;
        // for (var i = 0; i < data.length; i += 4) {
        //   data[i] = 0;
        //   data[i + 1] = 0;
        //   data[i + 2] = 0;
        //   data[i + 3] = 120;
        // }
        // ctx.putImageData(imageData, 0, 0);

        const coords = [
            {lat: 39.85915479295669, lng: -4.5263671875},
            {lat: 39.85915479295669, lng: -0.516357421875},
            {lat: 41.78769700539063, lng: -0.516357421875},
            {lat: 41.78769700539063, lng: -4.5263671875}
        ];
        const bounds = new window.google.maps.LatLngBounds();
        coords.forEach((coordPair) => bounds.extend(coordPair));
        setImageBounds(bounds);
        map.fitBounds(bounds);
        setOverlayPane(OverlayView.OVERLAY_MOUSE_TARGET);
    };

    //Get color of each pixel on mouse move
    const getRGBAFromPixel = (e) => {
        var rect = canvasRef.current.getBoundingClientRect();
        var pos = {
            x:
                ((e.clientX - rect.left) / (rect.right - rect.left)) *
                canvasRef.current.width,
            y:
                ((e.clientY - rect.top) / (rect.bottom - rect.top)) *
                canvasRef.current.height
        };
        var ctx = e.target.getContext("2d");
        var color = ctx.getImageData(pos.x, pos.y, 1, 1).data;
        console.log(color);
    };


    const showMarkerData = (marker) => console.log(marker);
    const clearMarkers = () => setMarkers([]);
    const clearImage = () =>
        setImageBounds(new window.google.maps.LatLngBounds());

    return (
        <LoadScript googleMapsApiKey="">
            <GoogleMap
                mapContainerStyle={{width: "100%", height: "100%"}}
                zoom={6}
                onLoad={onLoad}
                onUnmount={onUnmount}
                options={{
                    mapTypeControl: false,
                    mapTypeId: "satellite"
                }}
            >
                <button onClick={showImage} style={{position: "absolute"}}>
                    Show image
                </button>
                <button
                    onClick={clearImage}
                    style={{position: "absolute", top: "12%"}}
                >
                    Clear image
                </button>
                <OverlayView
                    bounds={imageBounds}
                    mapPaneName={overlayPane}
                    children={
                        <svg
                            // xmlns="http://www.w3.org/2000/svg"
                            // xmlns:xlink="http://www.w3.org/1999/xlink"
                            // xmlns:rdf="http://www.w3.org/1999/02/22-rdf-syntax-ns#"
                            // xmlns:dc="http://purl.org/dc/elements/1.1/"
                            // xmlns:cc="http://web.resource.org/cc/"
                            width="500pt"
                            height="600pt"
                        >
                            <link
                                xmlns=""
                                type="text/css"
                                rel="stylesheet"
                                id="dark-mode-custom-link"
                            />
                            <link
                                xmlns=""
                                type="text/css"
                                rel="stylesheet"
                                id="dark-mode-general-link"
                            />
                            <style
                                xmlns=""
                                lang="en"
                                type="text/css"
                                id="dark-mode-custom-style"
                            />
                            <style
                                xmlns=""
                                lang="en"
                                type="text/css"
                                id="dark-mode-native-style"
                            />
                            <style
                                xmlns=""
                                lang="en"
                                type="text/css"
                                id="dark-mode-native-sheet"
                            />

                            <defs>
                                <linearGradient id="linearGradient172">
                                    <stop
                                        // style="stop-color:#3f2600;stop-opacity:0.6;"
                                        offset="0"
                                        id="stop173"
                                    />

                                    <stop
                                        // style="stop-color:#3f2600;stop-opacity:0;"
                                        offset="1"
                                        id="stop174"
                                    />
                                </linearGradient>
                                <linearGradient id="linearGradient167">
                                    <stop
                                        // style="stop-color:#ffffff;stop-opacity:0.65;"
                                        offset="0"
                                        id="stop168"
                                    />

                                    <stop
                                        // style="stop-color:#ffffff;stop-opacity:0;"
                                        offset="1"
                                        id="stop169"
                                    />
                                </linearGradient>
                                <linearGradient id="linearGradient162">
                                    <stop
                                        // style="stop-color:#ffa63f;stop-opacity:1;"
                                        offset="0"
                                        id="stop163"
                                    />

                                    <stop
                                        // style="stop-color:#ffff00;stop-opacity:1;"
                                        offset="1"
                                        id="stop164"
                                    />
                                </linearGradient>
                                <linearGradient id="linearGradient153">
                                    <stop
                                        // style="stop-color:#ffeed7;stop-opacity:1;"
                                        offset="0"
                                        id="stop154"
                                    />

                                    <stop
                                        // style="stop-color:#bdbfc2;stop-opacity:1;"
                                        offset="1"
                                        id="stop155"
                                    />
                                </linearGradient>

                                <linearGradient id="linearGradient138">
                                    <stop
                                        // style="stop-color:#ffffff;stop-opacity:0.8;"
                                        offset="0"
                                        id="stop139"
                                    />

                                    <stop
                                        // style="stop-color:#ffffff;stop-opacity:0;"
                                        offset="1"
                                        id="stop140"
                                    />
                                </linearGradient>
                            </defs>

                            <g id="g1369" transform="translate(-310.7524,-64.25268)">
                                <path
                                    transform="matrix(1.4177,0,0,0.414745,-38.7944,222.194)"
                                    d="M 670.88202 1166.6423 A 203.89551 186.63016 0 1 1 263.091,1166.6423 A 203.89551 186.63016 0 1 1 670.88202 1166.6423 z"
                                    id="path175"
                                // style="fill:url(#radialGradient1399);stroke:none;stroke-width:1pt;stroke-linecap:butt;stroke-linejoin:miter"
                                />

                                <path
